import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expenses = [
    {id:"e1", title: "Car Insurance", amount: 20000, date: new Date(2021, 3, 28)},
    {id:"e2", title: "House Insurance", amount: 30000, date: new Date(2021, 4, 28)},
    {id:"e3", title: "Jobs", amount: 40000, date: new Date(2021, 5, 28)},
    {id:"e4", title: "Grocery", amount: 10000, date: new Date(2021, 6, 28)}
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
